import React from 'react';
import './Home.css';
import profile from "../../assets/images/profile.webp";

const Home = () => {
  return (
    <div className="home">
      <h1>I am Chirag, a freelancer, and I like to work on projects</h1>
      <div className="title">
        <h2 className="fullstack">Fullstack</h2>
        <h2 className="webdeveloper">Web Developer</h2>
      </div>
      <div className="profile-image">
        <img src={profile} alt="Chirag's profile" />
      </div>
      <div className="buttons">
        <button className="download">Download Resume</button>
        <button className="hire">Hire Me</button>
      </div>
    </div>
  );
};

export default Home;
